import React from "react";
import AuthService from "../services/auth.service";
import { Link, useHistory, useNavigate } from "react-router-dom";
import { useEffect, useState } from "react";
import bg from "../images/wbg.jpg";
import images1 from "../images/social.JPG";
let p = localStorage.getItem("username");
let j=localStorage.getItem("jwt");
const Profile = () => {
     const navigate = useNavigate();
  const logOut = () => {
    AuthService.logout();
    navigate("/");
  };
  const [user, setFaculty] = useState([]);
  const init = () => {
    AuthService.getUser(p)
      .then((response) => {
        console.log("Printing faculty data", response.data);
        setFaculty(response.data);
      })
      .catch((error) => {
        console.log("Something went wrong", error);
      });
  };
    useEffect(() => {
      init();
    }, []);
  return (
    <div
      className="profilepage"
      style={{
        backgroundImage: "url(" + bg + ")",
        backgroundSize: "cover",
        height: "40rem",
        width: "84.3rem",
      }}
    >
      {/* <header className="jumbotron">
        <h3>
          <strong>{user.username}</strong> Profile
        </h3>
      </header>
      <p>
        <strong>Token:{j}</strong>
      </p>
      <p>
        <strong>Id:</strong> {user.id}
      </p>
      <p>
        <strong>Email:</strong> {user.emailId}
      </p>
      <strong>Authorities:</strong>
      <ul>{user.roles}</ul>
      <ul>
        <button
          className="btn btn-danger ml-2"
          onClick={() => {
            logOut();
          }}
        >
          LOGOUT
        </button>
      </ul> */}

      <div
        className="profilepage"
        style={{
          backgroundImage: "url(" + bg + ")",
          backgroundSize: "cover",
          height: "40rem",
          width: "84.3rem",
        }}
      >
        <div class="profilepage">
          <div class="col-sm-3 sidenav">
            <h2
              style={{
                fontFamily: "monotype corsiva",
                paddingLeft: "5px",
                color: "white",
              }}
            >
              Welcome
            </h2>
            <h3
              style={{ color: "white", paddingLeft: "5px", paddingTop: "10px" }}
            >
              <strong>{user.username}</strong>
            </h3>

            <p
              class="active"
              style={{
                color: "white",
                paddingLeft: "5px",
              }}
            >
              Dashboard
            </p>

            <p style={{ color: "white", paddingLeft: "5px" }}>
              <strong>Email:</strong> {user.emailId}
            </p>
            <p style={{ color: "white", paddingLeft: "5px" }}>
              <strong>Age:</strong> {user.age}
            </p>
            <p style={{ color: "white", paddingLeft: "5px" }}>
              <strong>Gender:</strong> {user.age}
            </p>
            <p style={{ color: "white", paddingLeft: "5px" }}>
              <strong>Contact No:</strong> {user.ph_no}
            </p>
            <br></br>
            <button
              className="btn btn-danger ml-2"
              onClick={() => {
                logOut();
              }}
            >
              LOGOUT
            </button>
          </div>
        </div>
      </div>
      <footer id="footer">
        <ul class="navbar-nav">
          <li>
            Get connected with us on
            <img
              src={images1}
              alt="My Image"
              style={{ height: "3rem", width: "27rem" }}
            />
          </li>
        </ul>
      </footer>
    </div>
  );
};
export default Profile;
